  const books = [
    {
      title: "Harry Potter",
      author: "JK Rowling",
      description: "Wizards going to school",
    },
    {
      title: "Harry Potter 2",
      author: "JK Rowling",
      description: "Wizards going to school more",
    },
    {
      title: "Harry Potter    3",
      author: "JK Rowling",
      description: "Wizards going to school",
    },
  ];
  // const headerElement = React.createElement(Header, {title: "Hello from props!"});
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <Header title="Hello from props 2!" />
        {/* {headerElement} */}
      </header>
    </div>
  );
}

export default App;
